        setSearchText(event.target.value);
    }

    const filteredSearch = l.filter(liste => {return(liste.includes(SearchText))});

    return (
        <div>
            <SearchBar SearchThis={handleSearch}/>
            <List ListOfStuff={filteredSearch}/>
        </div>
    )
}
